Joe is a scripting language, implemented in Java, for adding scriptability to Java applications and libraries. I have developed Joe for use in my own personal projects, and as a hobby language; others might find it useful as well. The syntax is meant to be both familiar and a pleasant surprise for Java programmers: Joe loses much of the boilerplate and adds many new features. record Greeter(name) { method greet() { println("Hello, " + .name + "!"); }
} var greeter = Greeter("World");
greeter.greet(); Joe includes: Numbers, strings, keywords, booleans, lists, sets, and maps as basic data types. First-class functions with proper closures. Lambdas Classes with single inheritance Immutable record types Rust-like pattern matching A complete, tightly integrated Datalog subsystem called Nero. A test runner for scripted testing. An API documentation generator based on "Joe Doc" comments. A rich Java API for embedding Joe in Java apps and libraries, and for extending Joe's library to support new problem domains. Support for the JavaFX GUI library See The Joe Language and the sections that follow for a description of the language. The remainder of this introduction lays out my goals and non-goals for Joe, and the rationale for its creation, and can safely be skipped by those who want to get right to it.

