Joe doesn't use Object::toString when it needs to convert a value to a string; instead it calls Joe::stringify, which allows Joe to customize the value's script-level string representation. For example, all Joe numbers are java Doubles. The default string representation for doubles includes the fractional part, but Joe includes the fractional part only when it is non-zero. For proxied types, Joe::stringify calls the proxy's stringify method, which calls Object::toString by default. The client can override the proxy's stringify method to customize the returned value. For example, NumberType's stringify method removes the decimal part when it is zero. @Override
public String stringify(Joe joe, Object value) { assert value instanceof Double; String text = ((Double)value).toString(); if (text.endsWith(".0")) { text = text.substring(0, text.length() - 2); } return text;
}

