Axioms and rules are made up of atoms , as shown in this diagram: Parent(#anne, #bert);
──────────────────── ↑
Head atom Ancestor(x, y) :- Parent(x, z), Ancestor(z, y);
────────────── ──────────── ────────────── ↑ ↑ ↑
Head atom Body atom 1 Body atom 2 An atom consists of a relation and a parenthesized list of terms . The relation, e.g., Parent is a name for the relation between the atom's terms, e.g., #anne and #bert are related as parent and child. A relation is similar to the name of a table in an SQL database, where the set of facts having that relation are like the rows of the table. By convention, Nero relations begin with an uppercase letter. Nero supports several kinds of term ; this example includes two of them. #anne, #bert, and #clark are constant terms, and x, y, and z are variable terms. #anne, #bert, and #clark are, in fact, Joe keywords; Joe numbers, strings, booleans, and null can also be used as constants in Nero source.

