The aggregation function condition is as follows: If relation A aggregates over relation B then relation B must not depend on relation A, either directly or indirectly. If this condition is broken then the rule set might not terminate. Here's an extreme example in which A depends on itself: A(1);
A(2);
A(sum(x)) :- A(x); If allowed, this program would produce the following infinite stream of facts: A(3) A(6) A(12) A(24) ...

