A Nero program is embedded in a Joe script using the ruleset expression, which creates a value of type RuleSet . The following code creates a rule set called myRules. The content of the ruleset's body is just a Nero program as described in Nero Datalog . var myRules = ruleset { define Parent/parent,child; Parent(#anne, #bert); Parent(#bert, #clark); define Ancestor/ancestor,descendant; Ancestor(x, y) :- Parent(x, y); Ancestor(x, y) :- Parent(x, z), Ancestor(z, y);
}; A RuleSet can be used directly to infer facts from the rules and axioms, or to infer facts from a scripted collection of facts given the rules and axioms. For example, this script executes the rule set and outputs the inferred facts. foreach (fact : myRules.infer()) { println(fact);
} This will output the following Fact values (the order might differ). Fact(Parent, #bert, #clark)
Fact(Ancestor, #anne, #bert)
Fact(Ancestor, #anne, #clark)
Fact(Parent, #anne, #bert)
Fact(Ancestor, #bert, #clark)

