A Nero rule set can include axioms, as shown above, but usually it gets its input facts from the script. Facts can be created using the Fact type's initializer and static methods, but this is rarely necessary: any Joe value with named fields can be automatically converted into a Fact. This includes: Joe record values These become pair facts Joe class instances These become map facts Native types whose proxies define fields. These become pair facts The type's type name is used as the input fact's relation, and its fields as the fact's terms. In addition, a native type's proxy can explicitly override isFact and toFact to produce facts in any desired way. This script produces a list of Parent records, and passes it to the rule set's infer() method. The records are automatically converted to Parent facts. record Parent(parent, child) {} var inputs = [ Parent(#anne, #bert), Parent(#bert, #clark)
]; var myRules = ruleset { Ancestor(x, y) :- Parent(x, y); Ancestor(x, y) :- Parent(x, z), Ancestor(z, y);
}; foreach (fact : myRules.infer(inputs)) { println(fact);
}

