As with joe run and joe repl, Joe conducts all tests in a vanilla Joe interpreter; the only extensions are joe test's test API . A client project will usually wish to use the test runner for its own Joe bindings. And as with joe run, Joe can't predict the context in which those bindings will need to be tested; it might be an entire scriptable application. Thus, Joe expects that client will provide their own test tool. As of Joe 0.2.0, the simplest way to do this is to copy the test tool and modify the copy. The test tool is defined by the Java class com.wjduquette.joe.tools.test.TestTool. It is a short, straightforward file. The relevant code is in the runTest() method: // NEXT, configure the engine.
var joe = new Joe();
joe.installPackage(TestPackage.PACKAGE); At this point in runTest, install any required native functions, types, or packages as described in Extending Joe . We hope to make this simpler in a later release.

