A documentation comment is a block of comments beginning with the following marker comment: //** and continuing through contiguous comment lines until the next non-comment line: // Not in a doc comment //**
// @package my.package
//
// Information about `my.package` in Markdown format.
// ... // Not in a doc comment The comment prefix // must be the first non-whitespace text on each line. joe doc extracts all doc comment lines from a source file, removes the comment prefixes, and then parses them to extract the documentation according to its structure.

