Here is the beginning of the documentation in Joe's StandardLibrary.java file: //**
// @package joe
// @title Joe Standard Library
// The `joe` package contains Joe's standard library. ... java code ... //**
// @function catch
// @args callable
// @result CatchResult
// Executes the callable, which must not require any arguments.
// Returns a [[CatchResult]] indicating success or failure and providing
// the returned result or the error message respectively. ... java code ... This file defines the package itself, and the functions in the package. Consequently, it begins with a comment describing the @package, and the goes on to document each @function in turn. Some things to note: Each entity's documentation begins with its @entity tag. This is followed by metadata tags: @title for the @package and @args and @result for the @function. And these are followed by any number of lines of Markdown text. All such lines will be accumulated and ascribed to this entity until the next entity tag is seen.

