The @type entity documents a type, and so begins with @type <name>. The name should be the name of a type defined in the current package. The entity has the following optional metadata: Metadata Tag Meaning @extends <type> This type extends the named type. @includeMixin <mixin> This type's documentation includes the named mixin. <mixin> should be the name of a The @extends <type> tag is used when this type extends (i.e., subclasses) another script-visible type. The <type> should be the name or qualified name of a referenced @type. The @includesMixin <mixin> tag indicates that this type's documentation should include the documentation from a @mixin defined in this documentation set. The included documentation will be represented as part of the including type. The @type entity may have @constant , @static , @init , @field , @method , and @typeTopic children. For example, in the standard library the AssertError type extends the Error type, both of which are visible at the script-level. //**
// @type AssertError
// @extends Error
// ...

