The @mixin entity is like a pseudo-@type; it contains type content that would otherwise be duplicated in multiple @type entries. Mixin entities belong to the documentation set, not to any specific package, and may be included by any @type entity. Every mixin begins with @mixin <name>; mixin names must be unique within the documentation set. Mixins have no metadata tags, and may have Markdown content and @constant , @static , @field , @method , and @typeTopic children. When a type wants to include a mixin, it uses the @includesMixin <name> metadata tag. The mixin's Markdown content is inserted into the type's Markdown content at the location of the @includesMixin tag The mixin's children are then added to the type. A mixin is like a template; the string <type> may be included anywhere in the content of the mixin itself and its children, and will be replaced on inclusion by the including type's name. For example, the mixin might define: //**
// @mixin MyMixin
// // The `<type>` type is able to...
//
// @method myMethod
// @result <type>
// This method... Then, another type can include it like this: //**
// @type MyType
// The `MyType` type represents...
//
// @includeMixin MyMixin
//
// The MyMixin Markdown content is included above, replacing the include tag.

