The ~ operator matches a value against a destructuring pattern , returning true or false. For example, here it used to determine whether myValue contains a three-item list whose first item is #fred: if (myValue ~ [#fred, _, _]) { println("Match!");
} If the pattern contains binding variables, the variables are implicitly declared within the current scope. On a successful match they are set to the matching values within the target; on failure they are set to null: if (myValue ~ [#fred, height, weight]) { println("Fred is " + height + " inches tall,"); println("and weighs " + weight + " pounds.");
} See the Pattern Matching section for more about pattern matching and Joe's pattern syntax.

