The && and || operators provide short-circuit execution of Boolean expressions in the usual way. However, in Joe the values false and null are considered false in Boolean expressions, and all other values are considered true. Thus, instead of yielding true or false, && and || yield the last operand to be evaluated. Consider: var x = 5;
var y = null; println(x || 1); // Prints 5
println(y || 1); // Prints 1 The ! operator negates a Boolean expression, yielding true or false.

