All variables must be declared before use using the var statement. The var statement can assign an initial value; if the initial value is omitted, the variable is initialized to null. var x = 5;
var y; // y == null Joe is lexically scoped; undeclared variables in function or method bodies are presumed to be declared in an enclosing scope. It is an error if they are not. In addition to declaring and initializing individual variables, the var statement can use a pattern to perform a destructuring bind: that is, to bind one or more variables to values within a data structure. For example, suppose that the function f() returns a two-item list, and the caller wants to assign the list items to the variables x and y. One could do this: var result = f();
var x = result[0];
var y = result[1]; Or, one could do a destructing bind: var [x, y] = f(); Here, var matches the list returned by f() against the pattern [x, y] and binds variables x and y to the matched values. When the pattern doesn't match: If var's pattern doesn't match the target value, e.g., if f() didn't return a two-item list in the example shown above, then the pattern match will fail and Joe will throw a runtime error. Therefore, var should only be used when the shape of the target value is known ahead of time. Use the ~ operator or the match statement to test whether a value matches a particular pattern. See Pattern Matching for more on pattern matching and destructuring binds, including Joe's full pattern syntax.

