The match statement is similar to a switch statement, but matches patterns against a target value instead of checking for equality. It is especially useful for processing a heterogeneous list of values. match (value) { case [a, b] -> println("Two item list of " a + " and " + b + "."); case Person(name, age) -> println("Person " + name + " is " + age + " years old."); default -> println("no match");
} Every match statement requires at least one case; the default case is optional. (Note that matching on _, a simple wildcard pattern, is equivalent to the default case: match (value) { case [a, b] -> println("Two item list of " a + " and " + b + "."); case Person(name, age) -> println("Person " + name + " is " + age + " years old."); case _ -> println("no match");
} Each case in a match can include an optional guard clause that adds a boolean guard condition on top of the pattern match. In the following example the case matches any Person record, and then requires that the person be at least 10 years old. match (value) { ... case Person(name, age) if age >= 10 -> println("Person " + name + " is at least 10 years old."); ...
} See Pattern Matching for more on pattern matching and destructuring binds, including Joe's full pattern syntax.

