A destructuring bind is a way to bind one more variables to values within a complex data structure. The bind makes use of a pattern that duplicates the structure of the target value to match variable names to specific elements. For example, suppose that the function f() returns a two-item list, and the caller wants to assign the list items to the variables x and y. One could do this: var result = f();
var x = result[0];
var y = result[1]; Or, one could do a destructing bind using var: var [x, y] = f(); Here, var matches the list returned by f() against the pattern [x, y] and binds variables x and y to the matched values.

