Suppose the client application will pass values of this enum type into Joe code: enum Flavor {SWEET, SOUR} The Java EnumType<E> proxy will define that enum in Joe code so that the constants are accessible as Flavor.SWEET and Flavor.SOUR. Unfortunately, these are Joe expressions, not literal constants, and so cannot appear as literal constants in patterns. There are two ways a pattern can match a Java enum. First, it can use an interpolated expression: if (myEnum ~ [id, $(Flavor.SWEET)]) { println(id + " is sweet!");
} Second, it can use a keyword constant with the same name as the enum constant, disregarding case: if (myEnum ~ [id, #sweet]) { println(id + " is sweet!");
} Which option to use is a matter of taste; but it is typical for native functions and methods that take enum arguments to accept keywords in this way as well.

